September 4, 2020 - Day 462

"(David Bowie I Love You) Since I Was Six" was written by the Brian Jonestown Massacre for their third LP, "Take It From The Man" which is the beginning of their obsession with British garage rock and album titles/song titles referencing 60s rock in general. With that in mind, this song doesn't seem to be about David Bowie at all, however, the chord progression on the original version does seem reminiscent of "Space Oddity." The song is beautiful and one of their best despite it also sounding a bit like a funeral dirge. Mayfield's version, while still mournful, has more emphasis on the beauty of the tune. Dan Auerbach of The Black Keys produced the recording and it was on the soundtrack for the film "Apart" from 2011. "It's the brightness in your eyes / I see it all tonight / In the darkness of my light / Shining on the chosen few." #songadayforever #music #writingaboutmusic #jessicaleamayfield #brianjonestownmassacre #davidbowie #davidbowieiloveyousinceiwassix #danauerbach #antonnewcombe #matthollywood #joelgion";}i:199;a:1:{s:14:"comments_count";i:0;}i:200;a:1:{s:11:"likes_count";i:3;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvFlKvhV4w";}i:202;a:1:{s:5:"image";s:252:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/fr/e15/s1080x1080/118735525_413181252977702_5623514601227960308_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=vwjwuoKXrgUAX-i-IkV&oh=f1f73fbfb202e27244a8800689e7b2df&oe=5F7A8835";}i:203;a:1:{s:4:"type";s:5:"image";}i:204;a:1:{s:8:"owner_id";i:11871121342;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2391152977810800978";}i:209;a:1:{s:10:"short_code";s:11:"CEvFPbmB8FS";}i:210;a:1:{s:12:"created_time";i:1599267669;}i:211;a:1:{s:7:"caption";s:261:"Love everyone!

